?><p style="text-align: justify;"><span style="font-size: medium;"><span style="font-family: &quot;Times New Roman&quot;;">На данный момент, эти швейцарские часы находятся на пике своей популярности. Нельзя сказать, что это происходит из-за массированной рекламной «атаки». Вероятней всего, это из-за своей оригинальности, индивидуальности, и душевному подходу к производству часов. Эти знаменитые часы обладают высококачественными механизмами и деталями. Это одна из немногих швейцарских компаний, которая отводит очень много внимания на производство часов для женщин. Сама компания была основана в 1917 году, но называлась она тогда по-другому: «Schlup Co. ». Специализировалась компания на исключительном производстве механизмов и распространении их на рынке США. После многочисленных перестановок и смены руководства, в 1957 году, наконец-то компания выпускает первые собственные часы, под новым брендом Rado. Новые модели понравились часовой общественности, и вскоре, компания выпускает несколько новых коллекций, которые отличались своим высоким качеством и оригинальным дизайном. Окончательный стиль для своих часов, компания Rado разработала в начале 2004 года. И стиль, принятый тогда, до сих пор пользуется неизменной популярностью. Часы Rado это часы, которые всегда приятно ощущать на руках, ведь это сочетание великолепного дизайна и надежных деталей.</span></span></p>
 
